Promotional info - &quot;Warren Publishing's legendary anthology delivers a stunning variety of sorcery-filled fantasy, sexy science fiction, peculiar Victorian mystery, and morbid modern-day adventure all united by a common sense of profound horror! Richard Corben, Carmine Infantino, Jim Starlin, Bruce Jones, Sanjulian, Ken Kelly, and other classic creators deliver unparalleled screams and shudders in this deluxe volume, which collects all stories, letter columns, bonus pages, color inserts, goblins, countless demons, and fiery female warriors from Eerie #75 through #80 of this celebrated magazine! Foreword by comics writer/artist Peter Bagge (Reset, Hate)! &quot;

